// src/components/DoctorList.js
import React from 'react';

const DoctorList = ({ doctors }) => {
  return (
    <div>
      {doctors.map((doctor) => (
        <div key={doctor.id} className="doctor-card" data-testid="doctor-card">
          <h3 data-testid="doctor-name">{doctor.name}</h3>
          <p data-testid="doctor-specialty">
            {/* Check if specialties exists and is an array */}
            {Array.isArray(doctor.specialties) && doctor.specialties.length > 0 
              ? doctor.specialties.join(', ') 
              : 'No specialties available'}
          </p>
          <p data-testid="doctor-experience">Experience: {doctor.experience} years</p>
          <p data-testid="doctor-fee">Fee: â‚¹{doctor.fee}</p>
        </div>
      ))}
    </div>
  );
};

export default DoctorList;
